import React from "react";
import "bootstrap/dist/css/bootstrap.css";

const NavBar = () => {
  return (
    <React.Fragment>
      <nav className="navbar fixed-top navbar-light bg-light mx-auto">
        <a className="navbar-brand">Traffic Playback</a>
      </nav>
    </React.Fragment>
  );
};

export default NavBar;
